import { Box, Button, Toolbar, Typography } from "@mui/material";
import BACKIMAGE from "../assets/backgrounds/textureBack.jpg";
import { HOME } from "../../router/Router";
import { useNavigate } from "react-router-dom";

const Header = () => {
  const navigate = useNavigate();
  return (
    <Box
      sx={{
        //   padding: 10,
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        width: "100%",
        height: "60vh",
        // backgroundColor: "#023d65",
        backgroundImage: `url(${BACKIMAGE})`,
        backgroundRepeat: "no-repeat",
        backgroundPosition: "center",
        backgroundSize: "cover",
        textAlign: "center",
        fontSize: "5vw",
        // color: "#000",
      }}
    >
      <Toolbar
        sx={{ width: "100%", height: "100%", backgroundColor: "#304FA1aa" }}
      >
        <div className=" flex-1 p-[20px] md:p-[55px] lg:p-[90px] text-lg md:text-2xl lg:text-4xl">
          <Typography
            fontSize="32pt"
            color="#fff"
            sx={{ marginBottom: "20px", fontFamily: "Krona One" }}
          >
            Let's Connect with the Alcohol Free World Outside your Door
          </Typography>
          <Button
            className="mt-[30px]"
            // disabled={user ? false : true}
            onClick={() => {
              navigate(HOME);
            }}
            sx={{
              // width: 'fit-content',
              marginTop: "30px",
              fontFamily: "Krona One",
              fontWeight: "normal",
            }}
          >
            Create New Event
          </Button>
        </div>
        <div
          style={{
            flex: 1,
            padding: "20px",
            display: "flex",
            justifyContent: "center",
          }}
        >
          {/* <img
            src={SLIDE_LOGO}
            className="w-[75px] sm:w-[100px] md:w-[150px] lg:w-[200px]"
          /> */}
        </div>
      </Toolbar>
    </Box>
  );
};

export default Header;
